insert  into `suspectcrime`(`id`,`suspect_name`,`time`,`date`,`officers`,`ticket`,`arrest`,`fine`,`ticket_price`,`arrest_price`,`fine_price`,`illegal_items`,`details`,`done_by`) values (1,'Brandon_Bennett','19:28','22/5/2009','N/a',0,0,0,'$xx.xx','x minutes','$xx.xx','N/a','Suspect responded to an Ad in the paper, and  met the victim at the 24/7 in Hampton. The victim entered the vehicle, and was taken to a warehouse near the train tracks. Two accomplices then entered the vehicle, tieing the suspect in. They then asked for info on \"Joey Robinson\". Victim offered spot in Bloods and threatened to death if not compliant\n','J.Fa.19'),(2,'Francis_Cremonesi','22:08','01/5/2009','Einstein Best, Michael Davis',0,1,0,'$xx.xx','5','$92.00','Suspect was carrying 3 grams of white powder substance','\n','A.Pappas.03'),(3,'Mel_Carter','0:13','24/5/2009','Jian Fa',1,0,0,'$20.00','x minutes','$xx.xx','N/a','Speeding (8mph over the limit)\n','J.Fa.19'),(4,'Kamato_Toyama','21:14','24/5/2009','Einschtein Best',1,0,0,'$45.00','x minutes','$xx.xx','Include details of all illegal items here...','Where: The Strip, near Ammunation\nWho: Kamato Toyama\nWhen: Sunday evening, around 2100\nHe pulled over ASAP and just ticketed him. Situation fully under control.\n','E.Best.00'),(5,'Jack Knight','18:44','24/5/2009','Zavier Smith, Jian Fa',0,1,0,'$xx.xx','10 Minutes','$xx.xx','None','Speeding, wreckless driving, evading arrest, failure to comply.\n','J.Fa.19'),(6,'William_Arnaud','18:24','25/5/2009','Zavier Smith',1,0,0,'$50.00','x minutes','$xx.xx','No','The Strip speeding camera caught him driving. Officer Smith found him stopped at The Visage Casino, infront of it where a car accident took place(the car crashed into the pound there). William was ticketed and was issued a warning.\n','Z.Smith.00'),(7,'Ryo_Osamu','20:44','25/5/2009','Zavier Smith',1,0,0,'$50','x minutes','$xx.xx','Include details of all illegal items here...','Driving a black bucaneer. Went to the dice game at Four Dragons c